Ši pergalė sekė iškart po sensacingo laimėjimo prieš praėjusių metų čempionę Elektrėnų „Energiją“. Rungtynės su „Juodupe“ turėjo būti lengvesnės, bent jau taip manė kauniečiai, po dviejų kėlinių pirmavę 4:1, o rungtynių viduryje turėję net 4 įvarčių persvarą. Ir trečiojo kėlinio pradžia nežadėjo nieko blogo, tik geras emocijas, kai Vytautas Jagelavičius (43:06, dauguma) pelnė jau trečiąjį savo įvartį ir „Kaunas hockey“ pirmavo 5:1. Vėliau abi komandos apsikeitė įvarčiais ir šeimininkai turėjo saugų keturių įvarčių pranašumą, tačiau prarado budrumą. „Juodupė“ trijų legionierių Aleksejaus Nikulino, Nikitos Smirnovo ir Konstantino Isajevo įvarčiais grąžino intrigą ant ledo ir likus žaisti kiek mažiau nei tris su puse minutės rezultatas tapo 6:5. Paskutinę trečiojo kėlinio minutę „Juodupė“ pakeitė vartininką šeštu aikštės žaidėju, tačiau tai išėjo į naudą kauniečiams, kurie pelnė įvartį į tuščius vartus ir šventė pergalę 7:5. „Kaunas hockey“ į varžovų vartus metė 39 kartus, varžovai atsakė 32 metimais. Kauno klubas čempionate įgijo jau šešių taškų pranašumą prieš antrojoje vietoje esančią  „Energija“ , tačiau sužaidė trijomis rungtynėmis daugiau. Kitos Lietuvos ledo ritulio čempionato rungtynės įvyks trečiadienį Vilniuje, kur Pramogų arenos didžiojoje aikštėje 21 val. vietos  „Geležinis vilkas“  priims „Rokiškį“. (function(d, s, i, r) {
